import React from "react";
import './PortfolioPage.css'; // Import the CSS file for styling

function PortfolioPage() {
  return (
      <div className="portfolio-container">
        <div className="portfolio-text">
          <h1 className="small-text">Hi, I am Hongwei</h1>
          <h2 className="big-text">I build value through tech and design.</h2>
          <p className="description">
            I am from Beijing, China, and I live in Sydney, Australia now. <br />
            I am a tech and design lover, helping people build digital products.
          </p>
          <a href="#learn-more" className="learn-more-btn">Learn More</a>
        </div>
        <div className="portfolio-image">
          <img src="/images/hongwei.jpg" alt="Hongwei" />
        </div>
      </div>
  );
}

export default PortfolioPage;
